angular.module('HITS')
    .factory('ToastMessageService', function () {
       var callback = function () { };
       var messages = [];
       return {
           addAlerts: function (messageType, message) {
               messages.push({ type: messageType, msg: message });
               callback();
           },
           registerCallback: function (cb) {
               callback = cb;
           },
           getAlerts: function () {
               return messages;
           },
           removeAlerts: function () {
               messages = [];
               return messages;
           }
       };
    })
    .factory('SessionService', function() {
        var currentSession;// = {user_id: 0, username: "", institution_id: 0};
        var currentAcl;
        var isAnonymous = false;
        return {
            setSession: function(dataSession) {
                currentSession = dataSession;
            },
            getSession: function() {
                return currentSession;
            },
            setAclSession: function(dataAcl){
                currentAcl = dataAcl;
            },
            getAclSession: function(){
                return currentAcl;
            },
            setAcltoScope: function(scp){
                scp.currentAcl = {};

                angular.forEach(currentAcl, function(acl, k){
                    scp.currentAcl[acl] = true;
                });
            },
            setIsAnonymous: function(){
                isAnonymous = true;
            },
            isAnonymous: function(){
                return isAnonymous;
            }
        };
    })
    .factory('LoadingScreenService', function () {
        var callback = function () { };
        var isShow = true;
        return {
            showLoading: function () {
                isShow = true;
                callback();
            },
            registerCallback: function (cb) {
                callback = cb;
            },
            hideLoading: function () {
                isShow = false;
                callback();
            },
            getIsShow: function () {
                return isShow;
            }
        };
    })   
    .config(["$httpProvider", function ($httpProvider) {
        var $http,
        interceptor = function ($q, $injector, LoadingScreenService) {
            var rootScope;
            function success(response) {
                $http = $http || $injector.get('$http');
                if ($http.pendingRequests.length < 1) {
                    LoadingScreenService.hideLoading();
                }
                return response;
            }

            function error(response) {
                $http = $http || $injector.get('$http');
                if ($http.pendingRequests.length < 1) {
                    LoadingScreenService.hideLoading();
                }
                return $q.reject(response);
            }

            return function (promise) {
              
                LoadingScreenService.showLoading();
                return promise.then(success, error);
            };
        };
        interceptor.$inject = ["$q", "$injector", "LoadingScreenService"];
        $httpProvider.responseInterceptors.push(interceptor);
    }]);
angular.module('HITS')
    .controller('LocationListCtrl', 
        ["$rootScope", "$scope", "$resource", "$location", "$modal", "$timeout", "LocationService", "ToastMessageService", function LocationListCtrl($rootScope, $scope, $resource, $location, $modal, $timeout, LocationService, ToastMessageService) {
            var openModal = function(data) {
                $modal.open({
                    templateUrl: 'app/master/location/location-form/location-form.html',
                    controller: 'LocationFormCtrl',
                    resolve: {
                        locationData: function () {
                            return data;
                        }
                    }
                }).result.then(function (result) {
                    
                    var messageType = "", message = "";
                    if (result) {
                        messageType = "success";
                        message = "Data Saved Succesfully";
                    } else {
                        messageType = "danger";
                        message = "Error Saving Data";
                    }
                    ToastMessageService.addAlerts(messageType, message);
                    $scope.Fetch();
                });
            };

            $scope.Fetch = function () {
                var jsonResult = LocationService.FetchAll(function () {
                    $scope.locations = [];
                    var data_locations = jsonResult.data;
                    $scope.locations = data_locations;
                });
            };

            $scope.onCreateNew = function () {
                openModal({});
            };

            $scope.onRowEdit = function (locationData) {
                openModal(angular.copy(locationData));
            };

            $scope.onRowDelete = function (locationData) {
                var sel = confirm("Are you sure you want to delete the Location [" + locationData.location_name+ "] ?");
                if (sel) {
                    var jsonResult = LocationService.Delete(locationData, function () {
                        var messageType = "", message = "";
                        if (jsonResult) {
                            messageType = "success";
                            message = "Data Deleted Succesfully";
                        } else {
                            messageType = "danger";
                            message = "Error Deleting Data";
                        }
                        ToastMessageService.addAlerts(messageType, message);
                        $scope.Fetch();
                    });
                }
            };
            

            $scope.OnSearch = function() {
                $scope.Fetch();
            };
            

            $scope.Fetch();
        }]);

angular.module('HITS')
