angular.module('HITS')
    .controller('AddRoutingGroupUserCtrl', ["$scope", "$modalInstance", "routingGroup", "RoutingGroupService", "UserService", function ($scope, $modalInstance, routingGroup, RoutingGroupService, UserService) {
        $scope.routingGroup = routingGroup;

        var hash = {};
        angular.forEach($scope.routingGroup.RoutingUsers, function (routingUser, k) {
            hash[routingUser.user_id] = routingUser;
        });

        $scope.Fetch = function () {
            var jsonResult = UserService.FetchAll(function () {
                $scope.users = [];
                var dataUsers = jsonResult.data;
                $scope.users = dataUsers;

                angular.forEach($scope.users, function (u, k) {
                    if (hash[u.user_id]) {
                        u.is_available = false;
                    } else {
                        u.is_available = true;
                    }
                });
            });
        };

        $scope.Fetch();

        var toggleAction = function () {
            $scope.action = !$scope.action;
        };

        $scope.onSave = function (data) {
            toggleAction();

            angular.forEach($scope.users, function (user, k) {
                if (user.is_selected) {
                    var newRoutingUser = {
                        routing_user_id : 0,
                        routing_group_id : $scope.routingGroup.routing_group_id,
                        user_id : user.user_id,
                        is_active : true,
                        User : user,
                        RoutingGroup : $scope.RoutingGroup
                    };

                    $scope.routingGroup.RoutingUsers.push(newRoutingUser);
                }
            });

            var jsonResult = RoutingGroupService.Save($scope.routingGroup, function () {
                toggleAction();
                $modalInstance.close($scope.routingGroup);
            });
        };
    }]);
angular.module('HITS')
    .controller('AddRoutingGroupLocationCtrl', ["$scope", "LocationService", "RoutingGroupService", "routingUser", "routingGroup", "$modalInstance", function ($scope, LocationService, RoutingGroupService, routingUser, routingGroup, $modalInstance) {
        $scope.routingUser = routingUser;
        $scope.routingGroup = routingGroup;

        var hash = {};
        angular.forEach($scope.routingUser.RoutingLocations, function (loc, k) {
            hash[loc.location_id] = loc;
        });

        var jsonResult = LocationService.FetchAll(function () {
            $scope.locations = jsonResult.data;

            $scope.tempRoutingLocations = angular.copy($scope.routingUser.RoutingLocations);
            if ($scope.tempRoutingLocations == null)
                $scope.tempRoutingLocations = [];

            angular.forEach($scope.locations, function (loc, k) {
                if (!hash[loc.location_id]) {
                    $scope.tempRoutingLocations.push({
                        routing_user_id: $scope.routingUser.routing_user_id,
                        location_id: loc.location_id,
                        is_active: false,
                        Location: loc
                    });
                }
            });
        });

        var toggleAction = function () {
            $scope.action = !$scope.action;
        };

        $scope.onSave = function (data) {
            toggleAction();

            var locations = angular.copy($scope.tempRoutingLocations);
            $scope.routingUser.RoutingLocations = [];

            angular.forEach(locations, function (loc, k) {
                if (loc.routing_location_id || loc.is_active) {
                    $scope.routingUser.RoutingLocations.push(loc);
                }
            });
            var index = $scope.routingGroup.RoutingUsers.indexOf($scope.routingUser);
            $scope.routingGroup.RoutingUsers[index] = $scope.routingUser;

            var jsonResult = RoutingGroupService.Save($scope.routingGroup, function () {
                toggleAction();
                $modalInstance.close($scope.routingUser);
            });
        };
    }]);
